import React from 'react'

import { faQuoteLeft } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function QuoteItem() {
  return (
    <div id='quote-and-author-container'>
        <div className="quote-item">
        <FontAwesomeIcon icon={faQuoteLeft} className="icon" />
       
        <p id='text'>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Animi libero, porro possimus, odio architecto cumque dolorem quos, commodi deleniti velit iusto? Quos necessitatibus, repudiandae minima dolore eos fugit nobis officiis ut labore asperiores eaque, sunt aliquam. Rem voluptate exercitationem adipisci sint, molestiae maiores sapiente iure accusantium esse labore, aliquam sit.</p>
        </div>
        <small id='author'>- George Addair</small>
    </div>
  )
}

export default QuoteItem
